import React, { useState } from 'react';
import './APIWidgets.css';

const APIWidgets = () => {
  const [weather, setWeather] = useState(null);

  const apiKey = '2eaf366e4ec243d68c034719242308';

  const fetchWeather = () => {
    // Example API call
    fetch(
      'https://api.weatherapi.com/v1/current.json?key=apiKey&q=London'
    )
      .then((response) => response.json())
      .then((data) => setWeather(data));
  };

  return (
    <section className="api-widgets">
      <h2>API Widgets</h2>
      <div className="widget">
        <h3>Weather in London</h3>
        <button onClick={fetchWeather}>Get Weather</button>
        {weather && (
          <div>
            <p>Temperature: {weather.current.temp_c}Â°C</p>
            <p>Condition: {weather.current.condition.text}</p>
          </div>
        )}
      </div>
      {/* Add more widgets here */}
    </section>
  );
};

export default APIWidgets;
